import ReactDOM from 'react-dom';
function Card(){
    return(
        <>
        <div className="cards">
            <div className="card">
                <img 
                src="http://www.pop-culture.biz/play/0315IN.jpg" 
                alt="myPic" className="card__img"/>
                <div className="card__info">
                    <span className="card__category">A Netflix Original movie </span>
                    <h3 className="card__title"> Interstellar </h3>
                    <a href="http://www.pop-culture.biz/play/0315IN.jpg" target="_blank">
                        <button>Watch Now</button>
                    </a>
                </div>
            </div>
        </div>

    </>


    )
}
ReactDOM.render(
    <>
<Card/>
<Card/>

</>,
    document.getElementById("root")
);





























